(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["chunk-2d0d7fa7"],{"78b2":function(e){e.exports=JSON.parse('{"name":"Dynamic Programming","description":"Dynamic programming, like the divide-and-conquer method, solves problems by combining the solutions to subproblems. A dynamic-programming algorithm solves each subproblem just once and then saves its answer in a table, thereby avoiding the work of recomputing the answer every time it solves each subproblem.","items":[{"tags":[{"name":"dp","url":"/tags/dp"},{"name":"number theory","url":"/tags/number-theory"}],"title":"CF-980D Perfect Groups","excerpt":"SaMer has written the greatest test case of all time for one of his problems. For a given array of integers, the problem asks to find the minimum number of groups the array can be divided into, such that the product of any pair of integers in the same group is a perfect square.","updated_at":"2020-10-17T10:05:41+08:00","created_at":"2020-10-17T10:05:41+08:00","url":"/docs/acm/dp/cf-980d"},{"tags":[{"name":"dp","url":"/tags/dp"}],"title":"CF-213C Relay Race","excerpt":"Furik and Rubik take part in a relay race. The race will be set up on a large square with the side of $n$ meters. The given square is split into n×n n×n n×n cells (represented as unit squares), each cell has some number.","updated_at":"2020-10-17T10:05:41+08:00","created_at":"2020-10-17T10:05:41+08:00","url":"/docs/acm/dp/cf-213c"},{"tags":[{"name":"dp","url":"/tags/dp"}],"title":"CF-1393D Rarity and New Dress","excerpt":"Carousel Boutique is busy again! Rarity has decided to visit the pony ball and she surely needs a new dress, because going out in the same dress several times is a sign of bad manners. First of all, she needs a dress pattern, which she is going to cut out from the rectangular piece of the multicolored fabric.","updated_at":"2020-10-17T10:05:41+08:00","created_at":"2020-10-17T10:05:41+08:00","url":"/docs/acm/dp/cf-1393d"},{"tags":[{"name":"dp","url":"/tags/dp"}],"title":"洛谷P1833 樱花","excerpt":"爱与愁大神后院里种了 $n$ 棵樱花树，每棵都有美学值 $C_i$。爱与愁大神在每天上学前都会来赏花。爱与愁大神可是生物学霸，他懂得如何欣赏樱花：一种樱花树看一遍过，一种樱花树最多看 $A_i$ 遍，一种樱花树可以看无数遍。但是看每棵樱花树都有一定的时间 $T_i$。爱与愁大神离去上学的时间只剩下一小会儿了。求解看哪几棵樱花树能使美学值最高且爱与愁大神能准时（或提早）去上学。","updated_at":"2020-10-17T10:05:41+08:00","created_at":"2020-10-17T10:05:41+08:00","url":"/docs/acm/dp/luogu-1833"},{"tags":[{"name":"dp","url":"/tags/dp"}],"title":"CF-930C Teodor is not a liar!","excerpt":"Young Teodor enjoys drawing. His favourite hobby is drawing segments with integer borders inside his huge $[1;m]$ segment. One day Teodor noticed that picture he just drawn has one interesting feature: there doesn\'t exist an integer point, that belongs each of segments in the picture. Having discovered this fact, Teodor decided to share it with Sasha.","updated_at":"2020-10-17T10:05:41+08:00","created_at":"2020-10-17T10:05:41+08:00","url":"/docs/acm/dp/cf-930c"},{"tags":[{"name":"dp","url":"/tags/dp"}],"title":"CF-149D Coloring Brackets","excerpt":"Once Petya read a problem about a bracket sequence. He gave it much thought but didn\'t find a solution. Today you will face it.","updated_at":"2020-10-17T10:05:41+08:00","created_at":"2020-10-17T10:05:41+08:00","url":"/docs/acm/dp/cf-149d"},{"tags":[{"name":"dp","url":"/tags/dp"}],"title":"洛谷P4342 [IOI1998]Polygon","excerpt":"Polygon is a game for one player that starts on a polygon with $N$ vertices, like the one in Figure 1, where $N=4$. Each vertex is labelled with an integer and each edge is labelled with either the symbol + (addition) or the symbol * (product). The edges are numbered from $1$ to $N$.","updated_at":"2020-10-17T10:05:41+08:00","created_at":"2020-10-17T10:05:41+08:00","url":"/docs/acm/dp/luogu-4342"},{"tags":[{"name":"dp","url":"/tags/dp"}],"title":"洛谷P1064 金明的预算方案","excerpt":"金明今天很开心，家里购置的新房就要领钥匙了，新房里有一间金明自己专用的很宽敞的房间。更让他高兴的是，妈妈昨天对他说：“你的房间需要购买哪些物品，怎么布置，你说了算，只要不超过 $n$ 元钱就行”。今天一早，金明就开始做预算了，他把想买的物品分为两类：主件与附件，附件是从属于某个主件的。","updated_at":"2020-10-17T10:05:41+08:00","created_at":"2020-10-17T10:05:41+08:00","url":"/docs/acm/dp/luogu-1064"},{"tags":[{"name":"dp","url":"/tags/dp"}],"title":"CF-1271D Portals","excerpt":"You play a strategic video game (yeah, we ran out of good problem legends). In this game you control a large army, and your goal is to conquer $n$ castles of your opponent.","updated_at":"2020-10-17T10:05:41+08:00","created_at":"2020-10-17T10:05:41+08:00","url":"/docs/acm/dp/cf-1271d"},{"tags":[{"name":"dp","url":"/tags/dp"}],"title":"洛谷P2340 [USACO03FALL]Cow Exhibition G","excerpt":"贝西有权选择让哪些奶牛参加展览。由于负的智商或情商会造成负面效果，所以贝西不希望出展奶牛的智商之和小于零，或情商之和小于零。满足这两个条件下，她希望出展奶牛的智商与情商之和越大越好，请帮助贝西求出这个最大值。","updated_at":"2020-10-17T10:05:41+08:00","created_at":"2020-10-17T10:05:41+08:00","url":"/docs/acm/dp/luogu-2340"}],"url":"/categories/dp"}')}}]);
